(101,	'i\'d recommend making practice diffs with lower AR and slowly upping it once you pass them frequently. this way you can get used to ar 11 \"fast\" and in the meantime you memorize the map as well. \r\n\r\ncheese: turn gamma and brightness up.\r\n\r\nif you do these, your only problem should be HP. if you can\'t force yourself to read ar 11, you probably aren\'t ready for this medal.\r\n\r\nit will take a good amount of time to get this medal, personally it took me 3-4 hours with 58 total attempts on the official map (i practiced way more in custom diffs)\r\n\r\nalso don\'t be surprised if your pass medal will be an fc as well, because if you get bad accuracy, your hp will eventually go down towards the drop and you literally cant miss after it reaches the last 30% of your total hp. if you do get about ~80% accuracy, you can miss about 2-3 circles or 1 smaller slider to barely survive.\r\n\r\ngood luck!',	145,	NULL,	NULL,	'_aphantasia',	10663877,	'https://a.ppy.sh/10663877?1594458247.jpeg',	'2020-08-09 21:55:48',	0,	NULL,	NULL,	0),
