(242,	'Easier way: with the map \"Times Like These\", you can easly get 222,222.\r\n\r\n1. For that, play normally until get 10,000 or 20,000 pts before your goal with NF only.\r\n2. After that, hit perfectly sliders until your scre ends by 22 or 72. I agree, you need a little some luck... You can use spinners too.\r\n3. Then, hit only the circles (and no sliders and spinners), and never click 2 consecutives circles. If your score ends by 72, try to get 50 points with a circle. And you have to click only circle, but you need to be able to do 100 or 300 when you want to reach the 222,222 points.\r\n4. When you have 222,222 points, go outside or do nothing until the map ends. Good job, you have the medal.\r\n\r\nAlso, this map allows you to do some errors: he\'s 6:42 long. If you have more than 222,222, you can try 444,444 points. It\'s the same methode than 222,222, except you have your score ends by 44 or 94 before clicking circle.\r\nSame with 666,666 and 888,888, where you score must finish by {the same last 2',	41,	NULL,	NULL,	'Corne2Plum3',	15646039,	'https://a.ppy.sh/15646039?1607019792.jpeg',	'2020-12-23 00:44:08',	0,	NULL,	NULL,	0),
