(329,	'Be focused if you\'re doing CTB Megaman Mix +EZ. Just because it is easy does not mean you can\'t screw it up. Be very focused, look at every single fruit, know where you\'re supposed to be going, and execute your inputs or actions in a way where there is less of a chance you\'ll miss like for instance, standing between two fruits rather than moving left and right. It can be torturous having to retry from missing in the middle. Also, if you\'re not feeling good, don\'t go for it until you can comfortably try doing this. Good luck everybody going for this. :)',	44,	NULL,	NULL,	'Tomy',	14889628,	'https://a.ppy.sh/14889628?1614602214.jpeg',	'2021-03-12 22:57:48',	0,	NULL,	NULL,	0),
