(1356,	'actually xeroa is easiest one to pass, you can cheese nearly every pattern\ndont forget that this still is a 10* map and if you are not able to pass at least a 7* map you are most likely not \nskilled enough to pass xeroa\n\nprotips:\nplay this map on HT first, the knowlage of what patterns are on map are extremely helpful and if you can pass it for at least 76%  (i did 76) there is a good chance that nomod pass is in range of your skill if you cant, play more\n\nyou can start streaming/mashing [double tap dont work]part that starts at 50 second it makes this part easier\n\nyou cant doubletap kiai burst, just stream/mash as fast as you can and u will be fine (unless you are not able to mash 17 circles for atleast 230bpm)\n\nyou dont need to aim entire section after burst on kiai\nyou can actually click triple 4 - 5 - 2 and note on middle\njust forget that down left corner note is existing\n\non the last 1 - 2 spam just hit first 1-2 and then spam click  left [1] or right [2] notes after that doubleta',	244,	NULL,	NULL,	'FeverDream',	10808754,	'https://a.ppy.sh/10808754?1644322336.gif',	'2022-03-05 07:55:20',	0,	NULL,	NULL,	0),
(1357,	'p stream, you will be fine and alive\n\nmaking a practice diff for burst and second half of map is really helpful thing, just dont change anything.\n\n\ndont forget about last slider spam and burst, i died few times just because of that, be aware entire map\n\nand for last dont get demotivated, if you are convinced that you can pass it you will, this map took me like 5 hours to pass it and i am 4 digit who cant mash more than 230bpm ;)\n\nhere\'s example how to cheese it\nhttps://www.youtube.com/watch?v=SPEa2tTvu20',	244,	NULL,	NULL,	'FeverDream',	10808754,	'https://a.ppy.sh/10808754?1644322336.gif',	'2022-03-05 07:56:27',	0,	1356,	'FondermanP2P',	0),
