(1381,	'Boundary of space is probably one of the easiest ones for a 8* pass, you just need to worry about the section 05:52:192 to 06:02:453, the way i do it is make a practice diff for that section and delete all of the notes before and after the that section, then you press Ctrl   A to select all of the objects and press Ctrl   J to flip the objects Vertically, and change the cs 6.5,  change the ar to 8.5, and change the od to 8.4, now go and play the practice difficulty and play with only DTFL, now play the practice difficulty over and over again until you have a general idea on what to do on that part, other than that the map is pretty free',	62,	NULL,	NULL,	'ImproveMint',	19465417,	'https://a.ppy.sh/19465417?1644636908.jpeg',	'2022-03-17 05:28:55',	0,	NULL,	NULL,	0),
