(2285,	'Doesn\'t have to be SS\nUsing NF, this medal is basically free\n\n\nFor the method, you need the following beatmap:\nhttps://osu.ppy.sh/beatmapsets/1132727#osu/2365949\n\nSo what you need to do:\nIn Nao\'s Normal, you need to get 2x 100.\nYou can do this by hitting medium-sized sliders as if they were circles.\nIn total, you should give you 00.33% acc.\n\nNext you need to play Hard and get 1x 300, 1x 100 and 1x 50.\nGetting a 300 shouldn\'t be that hard.\nYou can get a 100 using the same method mentioned earlier.\nTo get a 50, I recommend clicking a reverse slider as if it was a circle.\nIn total, you should get 00.33% acc.\n\nScreenshots:\nhttps://media.discordapp.net/attachments/534400463051816980/980085800689623100/screenshot014.png\nhttps://media.discordapp.net/attachments/534400463051816980/980085800123379743/screenshot015.png',	274,	NULL,	NULL,	'TodNL',	21047081,	'https://osu.ppy.sh/images/layout/avatar-guest.png',	'2022-05-28 14:36:04',	0,	NULL,	NULL,	0),
