(2304,	'Even though I\'m bad at dashing, catch still turned out to be easier than taiko for me.\nIt took me a little over 2 hours total.\n\nAt the time of writing this, you need about 364 pp total.\nI tried to get as many 15-20pp plays and after some time I finally got the medal.\n\nIf you are planning to use catch, here is what I personally did:\n\nPlaying short 1-1.5* maps and trying to FC as many as possible\nI searched for 1-1.5* while having HR on and when having it off to find extra maps to play\nEven if you get a few misses on harder maps, it\'s still worth to try to set a score, as you may still get a decent bit of pp\nYou can check other players\' profiles and check their best plays to see if you can find some easy maps\nNot sure if it\'s just me, but connecting a controller with a joystick (and a button for dashing) helped me a lot',	50,	NULL,	NULL,	'TodNL',	21047081,	'https://osu.ppy.sh/images/layout/avatar-guest.png',	'2022-05-29 10:39:29',	0,	NULL,	NULL,	0),
