(4653,	'Asphodelos is the hardest, a tip that i have for this map is to keep your cursor on the object 02:54:030 (1). Copy all of these numbers and go to the editor and open the map, there are numbers in the bottom right, click that and a box will appear, just paste the numbers I mentioned here to see the object i\'m talking about. When you hit that circle, you can wait until the slider beneath that circle mentioned is clickable, the two objects after the object i mentioned isn\'t enough to kill all of your hp, you can do this thing on every chorus endings\n\nObject mentioned :\n\n[img]https://i.imgur.com/cZu0yee.png[/img]',	294,	NULL,	NULL,	'ImproveMint',	19465417,	'https://a.ppy.sh/19465417?1657258920.png',	'2022-11-16 12:56:14',	0,	NULL,	NULL,	0),
