(4656,	'If you use mouse then you should start trying to fix your mouse position when you feel that your mouse is drifting on objects like reverse sliders, stacks, or literally anything just to fix your mouse. This is really useful for the ending since it has two choruses back to back and it will make your mouse move to the top right side',	294,	NULL,	NULL,	'ImproveMint',	19465417,	'https://a.ppy.sh/19465417?1657258920.png',	'2022-11-16 13:02:44',	0,	4655,	'ImproveMint',	0),
