(7668,	'1.hues of madness = frums - theyaremanycolors.\n2.They rage = Hardrock (maybe?).\n3.eyeball in medal = hidden.\n4.Ailing mind = Dissociative Identity Disorder \n   (DID).https://osu.ppy.sh/beatmapsets/1533352#osu/4052458 - Description.\n5.Internment means being Imprisoned. \nIdk My opinion.',	323,	NULL,	NULL,	'CLICKMACHINE',	33072752,	'https://a.ppy.sh/33072752?1688472602.jpeg',	'2023-07-30 08:18:01',	0,	NULL,	NULL,	0),
(7669,	'Oh there\'s no doubt about it. It\'s definitely Frums - theyaremanycolors. The BG itself is a guy sitting, Imprisoned in a box (four walled jail). And the video literally shows the eye in that box. Need I say more. Maybe since it says many colors, as said by trung0246, We might need to pass (might have a certain amount of accuracy) every single difficulty. And since it says rage I\'m guessing we might have to pass it with Hardrock? And the medals\' picture is the eye as same in the video, but as cool_s said, we might need Hidden for the reason being the eyeball looks stained and dry as if we need to keep our eyes peeled. I mean the approach rate IS 9.8 in some diffs. So we can narrow down some solutions....\n\n1.Maybe we might have to FC the last difficulty with HR,HD (HD or HR can happen too) Highly unlikely cuz that looks impossible AF.\n2.Pass every difficulty with HD,HR (no accuracy needed, just pass?)\n3.Pass every diff or only the last diff with a certain accuracy using either HD or HR.\n\nAll in all I Think the 3rd option is more viable in this situation. I swear If it was the 1st solution, I\'m going to commit even MORE warcrimes.\nMy opinion.',	323,	NULL,	NULL,	'CLICKMACHINE',	33072752,	'https://a.ppy.sh/33072752?1688472602.jpeg',	'2023-07-30 08:45:49',	0,	7668,	'CLICKMACHINE',	0),
